// ProjectForm.js
import React, { useState } from "react";
import TeacherHome from "../components/teacher/home/teacher_home";
import TeacherNav from "../components/teacher/tempNav";
import './teacher_home_page.css'

function teacherHomePage({ saveProject, closeModal, teacherId }) {

  return (
    <div class="flex-container">
         <div class="flex-child">
            <TeacherNav/>
        </div>
        
        <div class="flex-child">
            <TeacherHome/>
        </div>
    </div>
    
  );
}

export default teacherHomePage;
